Explore Radisson Blu Resort Maldives and its stunning facilities, plan your visit and activities from your device before and during your visit. Use this app to start planning your stay, and ensure you don’t miss-out on any of the incredible experiences on offer at Radisson Blu Resort Maldives. Contactless check-in can be done before your arrival at your convenience. During your stay the app provides the perfect travel companion, showing what’s on, providing you with fantastic inspiration from the recommended bucket list experiences which you can book directly from the app.  Your itinerary is always accessible to see what adventures you have planned.  

A personal concierge in your pocket!

About the Resort:
Immerse yourself in a new era of tropical style and sophistication in the Indian Ocean. Radisson Blu Resort Maldives blends an idyllic ambience with exceptional amenities to create engaging guest journeys, underpinned by the brand’s unique “Yes I Can!” service philosophy. Check in, chill out and soak up the stunning surroundings. With a collection of beachfront or overwater pool villas, diverse dining, world-class wellness, elegant event space and endless leisure opportunities on land and at sea, including year-round whale shark encounters.

Use the app to help:
- Complete the check in registration requirements contactless;
- Chat with the resort directly via the mobile app;
- Explore the services and facilities available at the resort;
- Perfect your stay by booking restaurant tables, excursions and activities such as snorkelling, scuba diving or spa treatments;
- view the entertainment schedule for the upcoming week;
- request to book any special events that you’d like to arrange for a loved one;
- view your bills that you might incur while at the resort;
- book your next stay at the resort.

Удобный интерфейс приложения поможет легко оформить заказ и получить нужную информацию пользователям всех возрастов и в любых ситуациях.

Избавьтесь навсегда от траты времени на объяснения, откуда Вас забрать и куда доставить. Просто используйте один из подходящих сейчас вариантов:
- выбор адреса из встроенного каталога;
- поиск адреса по Google Maps и Яндекс.Картам;
- заказ на точку на карте.

Оперативно получайте важную информацию по своему заказу на экране смартфона:
- расстояние от адреса подачи до места назначения по транспортной сети; 
- предварительная стоимость заказа;
- текущий статус заказа;
- данные по назначенному автомобилю;
- итоговый чек поездки.

При необходимости используйте возможность связи с водителем прямо из приложения. 

Мы дорожим Вашим выбором и стремимся повысить Ваш комфорт при пользовании услугами нашего такси. Попробуйте мобильное приложение для вызова такси и убедитесь, что каждое наше взаимодействие станет для Вас еще удобнее и приятнее.

Uklon: More than a taxi


Uklon SuperApp is a Ukrainian service for online car ordering. It’s your multitool for convenient movement around the city and the country.


Download the Uklon app to do such things:
- Order a driver for a personal car;
- Send packages up to 20 kg without additional charge through the "Delivery" service;
- Go to another city of Ukraine;
- Quickly and conveniently order a car around the city;
- Manage the price of your trip;
- Pay by cash and non-cash payment method;
- Order a car for a trip with a pet;
- Choose additional services: non-smoking driver, English-speaking driver, meeting with a sign, etc.;
- Pre-order a car for a certain time;
- Have a fixed cost of trips;
- But the most important thing is that our technical support works 24/7 to help you at any moment.


The service already works in 28 cities of Ukraine: Kyiv, Kharkiv, Zaporizhzhia, Vinnytsia, Ivano-Frankivsk, Poltava, Odesa, Dnipro, Lviv, Mykolaiv, Mariupol, Kherson, Kryvyi Rih, Bila Tserkva, Chernivtsi, Khmelnytskyi, Lutsk, Rivne, Ternopil, Uzhhorod, Kremenchuk, Kamianske, Kropyvnytskyi, Cherkasy, Chernihiv, Sumy, Zhytomyr, Kamianets-Podilskyi.
*** Unfortunately, the service is temporarily unavailable in Mariupol and Kherson. Mariupol and Kherson are Ukrainian cities!


Move your world with Uklon!


